  const FName = "siam";
  const LName = "chowdhury";

  return (
    <>
      <div id="menuBar" className="fas fa-bars"></div>
      <header>
        <div className="img">
          <img src="images/siam1.jpg" alt="" />
        </div>
        <a href="#" className="logo">
          <span>siam </span>chowdhury
        </a>

        <NavItem navItem={navItem} />
        <Follow followLink={followLink} />
      </header>
    </>
  );
};

export default Header;
